#include "DrumFilter.h"

DrumFilter::DrumFilter() {
    juce::AudioBuffer<float> darbuka_1_buffer(1, 32768);
    darbuka_1_buffer.copyFrom(0, 0, DrumFilter::darbuka_1_IR, 32768);

    this->darbuka_conv_1.loadImpulseResponse(std::move(darbuka_1_buffer), 
        44100.0, 
        juce::dsp::Convolution::Stereo::no,
        juce::dsp::Convolution::Trim::no, 
        juce::dsp::Convolution::Normalise::no);
    this->darbuka_conv_1.prepare({44100.0, 2048, 1});

    juce::AudioBuffer<float> darbuka_2_buffer(1, 32768);
    darbuka_2_buffer.copyFrom(0, 0, DrumFilter::darbuka_2_IR, 32768);

    this->darbuka_conv_2.loadImpulseResponse(std::move(darbuka_2_buffer), 
        44100.0, 
        juce::dsp::Convolution::Stereo::no,
        juce::dsp::Convolution::Trim::no, 
        juce::dsp::Convolution::Normalise::no);
    this->darbuka_conv_2.prepare({44100.0, 2048, 1});
}

void DrumFilter::getBlock(juce::AudioBuffer<float> buffer, float ratio, float wet) {

    juce::dsp::AudioBlock<const float> input_block(buffer);

    juce::AudioBuffer<float> out_buf_1(1, buffer.getNumSamples());
    juce::dsp::AudioBlock<float> out_block_1(out_buf_1);
    juce::dsp::ProcessContextNonReplacing<float> context_1(input_block, out_block_1);
    this->darbuka_conv_1.process(context_1);

    juce::AudioBuffer<float> out_buf_2(1, buffer.getNumSamples());
    juce::dsp::AudioBlock<float> out_block_2(out_buf_2);
    juce::dsp::ProcessContextNonReplacing<float> context_2(input_block, out_block_2);
    this->darbuka_conv_2.process(context_2);

    for(uint i = 0; i < buffer.getNumSamples(); i++) {
        double filtered = out_block_1.getSample(0, i) * ratio +
                          out_block_2.getSample(0, i) * (1 - ratio);
        buffer.getWritePointer(0)[i] = filtered * wet + input_block.getSample(0, i) * (1 - wet);
    }
}

